import{_ as a,c as e,o,a2 as r}from"./chunks/framework.B8eppuLz.js";const h=JSON.parse('{"title":"Perguntas frequentes (FAQ)","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"faq.md","filePath":"faq.md","lastUpdated":1725021905000}'),s={name:"faq.md"},i=r('<h1 id="perguntas-frequentes-faq" tabindex="-1">Perguntas frequentes (FAQ) <a class="header-anchor" href="#perguntas-frequentes-faq" aria-label="Permalink to &quot;Perguntas frequentes (FAQ)&quot;">​</a></h1><h2 id="_1-como-posso-utilizar-as-ferramentas-de-calculo" tabindex="-1">1. Como posso utilizar as ferramentas de cálculo? <a class="header-anchor" href="#_1-como-posso-utilizar-as-ferramentas-de-calculo" aria-label="Permalink to &quot;1. Como posso utilizar as ferramentas de cálculo?&quot;">​</a></h2><p>Basta acessar diretamente o site das ferramentas. As versões em produção disponíveis estão listadas no <a href="https://www.trf3.jus.br/fabrica-de-calculos/ferramentas" target="_blank" rel="noreferrer">site da Fábrica de Cálculos</a>.</p><h2 id="_2-para-utilizar-a-ferramenta-e-necessario-fazer-algum-tipo-cadastro" tabindex="-1">2. Para utilizar a ferramenta é necessário fazer algum tipo cadastro? <a class="header-anchor" href="#_2-para-utilizar-a-ferramenta-e-necessario-fazer-algum-tipo-cadastro" aria-label="Permalink to &quot;2. Para utilizar a ferramenta é necessário fazer algum tipo cadastro?&quot;">​</a></h2><p>Não é necessário nenhum tipo de cadastro, bastando acessar o site da ferramenta.</p><h2 id="_3-quais-sao-as-ferramentas-disponives-pela-fabrica-de-calculos" tabindex="-1">3. Quais são as ferramentas disponíves pela Fábrica de Cálculos? <a class="header-anchor" href="#_3-quais-sao-as-ferramentas-disponives-pela-fabrica-de-calculos" aria-label="Permalink to &quot;3. Quais são as ferramentas disponíves pela Fábrica de Cálculos?&quot;">​</a></h2><p>Atualmente, a Fábrica de Cálculos disponibiliza as seguintes ferramentas:</p><ul><li><a href="/docs/tc.html">Cálculo de Benefícios</a></li><li><a href="/docs/rvt.html">Cálculo de Revisão da Vida Toda</a></li><li>Enquadramento de Tempo Especial</li></ul><h2 id="_4-como-importar-dados-do-cnis-sat" tabindex="-1">4. Como importar dados do CNIS/SAT? <a class="header-anchor" href="#_4-como-importar-dados-do-cnis-sat" aria-label="Permalink to &quot;4. Como importar dados do CNIS/SAT?&quot;">​</a></h2><p>Veja o passo a passo <a href="/docs/tc.html#importacao-do-extrato-cnis-relacoes-previdenciarias-e-remuneracoes-e-dados-de-outras-planilhas">neste link</a>.</p><h2 id="_5-ocorreu-um-erro-quando-tentei-importar-os-dados-de-um-documento-o-que-devo-fazer" tabindex="-1">5. Ocorreu um erro quando tentei importar os dados de um documento. O que devo fazer? <a class="header-anchor" href="#_5-ocorreu-um-erro-quando-tentei-importar-os-dados-de-um-documento-o-que-devo-fazer" aria-label="Permalink to &quot;5. Ocorreu um erro quando tentei importar os dados de um documento. O que devo fazer?&quot;">​</a></h2><p>Para que a importação seja bem sucedida, os dados devem ser obtidos de um arquivo válido. Maiores informações sobre como importar dados podem ser obtidas nesses links: <a href="/docs/tc.html#importacao-da-contagem-do-inss">importação da contagem do INSS</a> e <a href="/docs/tc.html#importacao-do-extrato-cnis-relacoes-previdenciarias-e-remuneracoes-e-dados-de-outras-planilhas">importação do extrato CNIS e outras planilhas</a></p><h2 id="_6-consigo-recuperar-um-calculo-ja-feito-anteriormente" tabindex="-1">6. Consigo recuperar um cálculo já feito anteriormente? <a class="header-anchor" href="#_6-consigo-recuperar-um-calculo-ja-feito-anteriormente" aria-label="Permalink to &quot;6. Consigo recuperar um cálculo já feito anteriormente?&quot;">​</a></h2><p>Buscando a total conformidade com a Lei Geral de Proteção de Dados, atualmente a ferramenta não possui um banco de dados, todavia qualquer cálculo pode ser salvo/baixado no computador, clicando no botão <code>Salvar</code> no canto superior direito. Para recuperar o cálculo feito, deve ser utilizado o botão <code>Abrir</code>, selecionando o arquivo salvo anteriormente. Mais informações sobre a funcionalidade podem ser obtidas nesses links: <a href="/docs/tc.html#salvar">botão salvar</a> e <a href="/docs/tc.html#abrir">botão abrir</a>.</p><h2 id="_7-a-ferramenta-calculo-de-beneficios-analisa-a-reafirmacao-de-der" tabindex="-1">7. A ferramenta <code>Cálculo de Benefícios</code> analisa a reafirmação de DER? <a class="header-anchor" href="#_7-a-ferramenta-calculo-de-beneficios-analisa-a-reafirmacao-de-der" aria-label="Permalink to &quot;7. A ferramenta `Cálculo de Benefícios` analisa a reafirmação de DER?&quot;">​</a></h2><p>Sim. É possível realizar a análise da reafirmação da DER com base nos dados inseridos e na aba <a href="/docs/tc.html#hoje">Hoje</a>.</p><h2 id="_8-a-ferramenta-calculo-de-beneficios-analisa-qualidade-de-segurado" tabindex="-1">8. A ferramenta <code>Cálculo de Benefícios</code> analisa qualidade de segurado? <a class="header-anchor" href="#_8-a-ferramenta-calculo-de-beneficios-analisa-qualidade-de-segurado" aria-label="Permalink to &quot;8. A ferramenta `Cálculo de Benefícios` analisa qualidade de segurado?&quot;">​</a></h2><p>Não, mas essa demanda já foi levada à equipe de desenvolvimento para análise.</p><h2 id="_9-a-ferramenta-calculo-de-beneficios-calcula-rmi-com-aplicacao-da-regra-dos-descartes" tabindex="-1">9. A ferramenta <code>Cálculo de Benefícios</code> calcula RMI com aplicação da &quot;regra dos descartes&quot;? <a class="header-anchor" href="#_9-a-ferramenta-calculo-de-beneficios-calcula-rmi-com-aplicacao-da-regra-dos-descartes" aria-label="Permalink to &quot;9. A ferramenta `Cálculo de Benefícios` calcula RMI com aplicação da &quot;regra dos descartes&quot;?&quot;">​</a></h2><p>Sim, a ferramenta calcula a RMI conforme sistemática do artigo 26, § 6º da Emenda Constitucional nº 103/2019.</p><h2 id="_10-nao-consigo-iniciar-um-calculo-da-revisao-da-vida-toda-rvt-o-que-devo-fazer" tabindex="-1">10. Não consigo iniciar um cálculo da Revisão da Vida Toda (RVT). O que devo fazer? <a class="header-anchor" href="#_10-nao-consigo-iniciar-um-calculo-da-revisao-da-vida-toda-rvt-o-que-devo-fazer" aria-label="Permalink to &quot;10. Não consigo iniciar um cálculo da Revisão da Vida Toda (RVT). O que devo fazer?&quot;">​</a></h2><p>Para realização de <ins>qualquer cálculo</ins> é necessário importar a <code>Carta de Concessão</code> do benefício. O procedimento pode ser consultado <a href="/docs/rvt.html#importacao-da-carta-de-concessao-e-extrato-cnis-sat">neste link</a></p>',22),d=[i];function t(c,n,l,u,m,f){return o(),e("div",null,d)}const q=a(s,[["render",t]]);export{h as __pageData,q as default};
